Flash Professional CS5 and Flash Catalyst CS5 For Dummies By Ellen Finkelstein, Gurdy Leete, Mary Leete.

A full-colour guide for getting rewarding results with the latest version of Flash
Flash is used in the creation of Web animation, games, media rich Web sites, presentations, and more. Adobe has divided the new version of Flash into three separate products for different audiences, and this book covers the Professional product; the traditional animation/media serving tool; and Catalyst, the Web/interface design tool. This book provides a fun and friendly full-colour guide to Flash. Walks you through both Professional and Catalyst as well as the traditional Flash animation tool 

